import React from 'react';
import Form from './Form';
import './App.css';

function App() {
  const getDataHandler = (event) =>{
    const data = [...event, event];
    console.log(data);
  }
  return (
    <div>
      <Form getdata={getDataHandler}/>
    </div>
  );
}

export default App;
